        $passwordOtherValue = 'cyphered://ocyphered';
        $copy = $value->password($passwordOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals('cyphered://cypher', $value->getPassword());
        $this->assertNotEquals('cyphered://ocyphered', $value->getPassword());
        $this->assertEquals('****er', $value->getPasswordOrDefault(UserPasswordVO::from($passwordOtherValue))->value());
        $this->assertNotEquals('****ed', $value->getPasswordOrDefault(UserPasswordVO::from($passwordOtherValue))->value());
        $value->unsetPassword();
        $this->assertEquals('****ed', $value->getPasswordOrDefault(UserPasswordVO::from($passwordOtherValue))->value());
        $this->assertNotEquals('****er', $value->getPasswordOrDefault(UserPasswordVO::from($passwordOtherValue))->value());
