        $this->assertNotEquals('****ed', $value->getSecondFactorSeedOrDefault(UserSecondFactorSeedVO::from($secondFactorSeedOtherValue))->value());
        $value->unsetSecondFactorSeed();
        $this->assertEquals('****ed', $value->getSecondFactorSeedOrDefault(UserSecondFactorSeedVO::from($secondFactorSeedOtherValue))->value());
        $this->assertNotEquals('****er', $value->getSecondFactorSeedOrDefault(UserSecondFactorSeedVO::from($secondFactorSeedOtherValue))->value());
        $tempSecondFactorSeedOneValue = 'cyphered://cypher';
        $tempSecondFactorSeedOtherValue = 'cyphered://ocyphered';
        $copy = $value->tempSecondFactorSeed($tempSecondFactorSeedOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals('cyphered://cypher', $value->getTempSecondFactorSeed());
        $this->assertNotEquals('cyphered://ocyphered', $value->getTempSecondFactorSeed());
