        $this->assertNotEquals('****ed', $value->getTempSecondFactorSeedOrDefault(UserTempSecondFactorSeedVO::from($tempSecondFactorSeedOtherValue))->value());
        $value->unsetTempSecondFactorSeed();
        $this->assertEquals('****ed', $value->getTempSecondFactorSeedOrDefault(UserTempSecondFactorSeedVO::from($tempSecondFactorSeedOtherValue))->value());
        $this->assertNotEquals('****er', $value->getTempSecondFactorSeedOrDefault(UserTempSecondFactorSeedVO::from($tempSecondFactorSeedOtherValue))->value());
