        $failedLoginAttemptsOtherValue = 2;
        $copy = $value->failedLoginAttempts($failedLoginAttemptsOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals(1, $value->getFailedLoginAttempts());
