        $copy = $value->recoveryCodeExpiration($recoveryCodeExpirationOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals((new \DateTimeImmutable('1980-08-20T14:32:45.123Z')), $value->getRecoveryCodeExpiration());
