        $this->assertEquals((new \DateTimeImmutable('1981-09-06T14:32:45.123Z')), $value->getRecoveryCodeExpirationOrDefault(UserRecoveryCodeExpirationVO::from($recoveryCodeExpirationOtherValue))->value());
        $this->assertNotEquals((new \DateTimeImmutable('1980-08-20T14:32:45.123Z')), $value->getRecoveryCodeExpirationOrDefault(UserRecoveryCodeExpirationVO::from($recoveryCodeExpirationOtherValue))->value());
