        $this->assertNotEquals('other', $value->getLanguageOrDefault(UserLanguageVO::from($languageOtherValue))->value());
        $value->unsetLanguage();
        $this->assertEquals('other', $value->getLanguageOrDefault(UserLanguageVO::from($languageOtherValue))->value());
        $this->assertNotEquals('one', $value->getLanguageOrDefault(UserLanguageVO::from($languageOtherValue))->value());
        $providerOneValue = 'one';
        $providerOtherValue = 'other';
        $copy = $value->provider($providerOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals('one', $value->getProvider());
